--
-- Name: view_conferencedaysplaces; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_conferencedaysplaces AS
 SELECT cd.conferencedayid,
    cd.conferences_conferenceid,
    cd.numberofparticipants AS totalplaces,
    COALESCE(sum(cdb.participantsnumber), (0)::bigint) AS bookedplaces,
    (cd.numberofparticipants - COALESCE(sum(cdb.participantsnumber), (0)::bigint)) AS freeplaces
   FROM (conferencedays cd
     LEFT JOIN conferencedaybook cdb ON ((cdb.conferencedays_conferencedaysid = cd.conferencedayid)))
  GROUP BY cd.conferencedayid, cd.conferences_conferenceid, cd.numberofparticipants;


