 SELECT cc.companyclientid,
    cc.clients_clientid,
    cc.name,
    cc.email,
    cc.phone,
    cc.address,
    COALESCE(( SELECT count(*) AS count
           FROM conferencebooks cb
          WHERE (cb.clients_clientid = cc.clients_clientid)), (0)::bigint) AS totalbooks,
    COALESCE(( SELECT sum(p.amount) AS sum
           FROM (conferencebooks cb
