          WHERE (cb.clients_clientid = cc.clients_clientid)), (0)::numeric) AS totalpayments
   FROM companyclients cc
  ORDER BY COALESCE(( SELECT count(*) AS count
           FROM conferencebooks cb
          WHERE (cb.clients_clientid = cc.clients_clientid)), (0)::bigint);


