--
-- Name: view_themostpopularworkshops; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW view_themostpopularworkshops AS
 SELECT conferences.name AS conferencename,
    workshops.workshopid,
    workshops.name,
    ((COALESCE(sum(workshopbook.participantnumber), (0)::bigint) * 100) / workshops.numberofparticipants) AS popularity
   FROM (((workshops
     JOIN workshopbook ON ((workshopbook.workshops_workshopid = workshops.workshopid)))
     JOIN conferencedays ON ((conferencedays.conferencedayid = workshops.conferencedays_conferencedaysid)))
     JOIN conferences ON ((conferences.conferenceid = conferencedays.conferences_conferenceid)))
  GROUP BY workshops.workshopid, workshops.name, workshops.numberofparticipants, conferences.name
  ORDER BY ((COALESCE(sum(workshopbook.participantnumber), (0)::bigint) * 100) / workshops.numberofparticipants) DESC
 LIMIT 10;


